import './card.css';

export default function Cards ({nome, ra, codCurso, img}){

    return(
        < div className='card'>
            <div>
                <img src={img} width={150} height={150}/> 
            </div>
            <div className='nome'>
                {nome}
            </div>
            <div className='ra'>
                RA: {ra}
            </div>
            <div className='codCurso'>
                {codCurso === 19 ? 'Informática' : codCurso === 39 ? 'DS Vesp' : 'DS Not'}
            </div>
        </div>
    )
}
